css:
:root {
  font-size: 16px;
}
.bottom-dock .tab-manager .tab-button {
  background: #43484d;
  text-shadow: none;
  border: 1px solid rgba(0, 0, 0, 0.1);
  border-left: 0;
  border-radius: 0;
  height: initial;
  line-height: 1.8em;
}
.bottom-dock .tab-manager .tab-button:first-child {
  border-left: 1px solid #181818;
}
.bottom-dock .tab-manager .tab-button:hover .delete-button {
  visibility: visible;
}
.bottom-dock .tab-manager .tab-button.selected {
  background-color: #5c6064;
  color: rgba(131, 148, 150, 0.6);
}
.bottom-dock .bottom-dock-header {
  background-color: #43484d;
  border: 1px solid rgba(0, 0, 0, 0.1);
  border-top: 0;
  border-bottom: 0;
  padding-bottom: 4px;
}
.bottom-dock .bottom-dock-header .dock-resize-handle {
  height: 4px;
  cursor: ns-resize;
}
.bottom-dock .bottom-dock-header .title {
  color: rgba(131, 148, 150, 0.6);
  padding-left: 10px;
  vertical-align: middle;
}
.bottom-dock .bottom-dock-header .button-container {
  float: right;
}
.bottom-dock .bottom-dock-header .button-container span {
  padding-left: 10px;
  vertical-align: middle;
  padding: 0px;
  cursor: pointer;
}
.bottom-dock .bottom-dock-header .button-container .delete-button {
  color: #f44336;
}
.bottom-dock .bottom-dock-header .button-container .delete-button:hover {
  color: #fbb4af;
}
.bottom-dock .bottom-dock-header .button-container .delete-button:active {
  color: rgba(131, 148, 150, 0.6);
}
.bottom-dock .pane-manager {
  height: 250px;
  display: block;
  overflow: hidden;
  background-color: transparent;
  border: 1px solid rgba(0, 0, 0, 0.1);
  border-bottom: 0px;
}
.bottom-dock .table-container {
  overflow: auto;
  flex: 1 1;
}
.bottom-dock .table-container table {
  table-layout: fixed;
}
.bottom-dock .table-container table td {
  cursor: pointer;
  overflow: hidden;
  text-overflow: ellipsis;
  white-space: nowrap;
  min-width: 20px;
}
.bottom-dock .table-container table th {
  overflow: hidden;
  text-overflow: ellipsis;
  min-width: 20px;
  font-weight: normal;
}
.bottom-dock-status-container {
  margin-left: 10px;
  cursor: pointer;
}
.bottom-dock-status-container:hover {
  text-decoration: underline;
}
